import SignupForm from './components/LoginPage/SignupForm';
import LeftOverlayContent from './components/LoginPage/LeftOverlayContent';
import RightOverlayContent from './components/LoginPage/RightOverlayContent'
function App() {
  return (

    <div className="App">

      <SigninForm/>
      <SignupForm/>
      <LeftOverlayContent/>
      <RightOverlayContent/>
    </div>

  );
}


export default App;
